    comment: "<p>\n	<span style=\"font-size: 20px;\"><strong>K&aelig;re netv&aelig;rksdeltager i Bluegarden</strong></span><br />\n	Vi er glade for, at du vil deltage i vores brugerunders&oslash;gelse, s&aring; vi ogs&aring; f&aring;r dit input til, hvad vores kommende l&oslash;sninger b&oslash;r indeholde for at underst&oslash;tte dine behov, n&aring;r du l&oslash;ser dine arbejdsopgaver.<br />\n	Vi er i gang med at planl&aelig;gge v&aelig;sentlige forbedringer af de rapporteringsmuligheder, du i dag oplever i vores MultiL&oslash;n produkter og Orkid&eacute;. I den forbindelse vil vi gerne have dit input til konkrete rapportpakker/dashboards &ndash; herunder vigtigheden af pakkerne set i forhold til hinanden og en prioritering af selve indholdet af pakkerne/dashboards.<br />\n	Du skal forestille dig, at der i hver pakke ligger en r&aelig;kke fast definerede rapporter, som er opdaterede, n&aring;r du &aring;bner dem. Hvor det giver mening, vil der selvf&oslash;lgelig ogs&aring; v&aelig;re mulighed for at v&aelig;lge tidsintervaller. Rapporterne pr&aelig;senteres i et l&aelig;kkert lay-out, og planen er, at du som udgangspunkt selv kan koble yderligere &oslash;vrige data p&aring;, skulle du mangle oplysninger.<br />\n	Det vil tage omkring 10 minutter at besvare vores sp&oslash;rgsm&aring;l, og det vil give os vigtig information til den videre proces.<br />\n	Du er meget velkommen til at notere kommentarer undervejs &ndash; al input er vigtigt for os! Vi gl&aelig;der os til at l&aelig;se dine svar.</p>\n<p>\n	Venlig hilsen Bluegarden</p>\n"
